webpackJsonp([0xc318922c1f93],{3211:function(e,n){e.exports={pathContext:{docHtml:'<h1>2.3.0</h1>\n<ul>\n<li>Enabled <code>.field()</code> to handle objects (Affan Shahid)</li>\n<li>Added authentication with client certificates (terusus)</li>\n<li>Added <code>.catch()</code> for more Promise-like interface (Maxim Samoilov, Kornel Lesiński)</li>\n<li>Silenced errors from incomplete gzip streams for compatibility with web browsers (Kornel Lesiński)</li>\n<li>Fixed <code>event.direction</code> in uploads (Kornel Lesiński)</li>\n<li>Fixed returned value of overwritten response object\'s <code>on()</code> method (Juan Dopazo)</li>\n</ul>\n<h1>2.2.0</h1>\n<ul>\n<li>Added <code>timedout</code> property to node Request instance (Alexander Pope)</li>\n<li>Unified <code>null</code> querystring values in node and browser environments. (George Chung)</li>\n</ul>\n<h1>2.1.0</h1>\n<ul>\n<li>Refactored async parsers. Now the <code>end</code> callback waits for async parsers to finish (Kornel Lesiński)</li>\n<li>Errors thrown in <code>.end()</code> callback don\'t cause the callback to be called twice (Kornel Lesiński)</li>\n<li>Added <code>headers</code> to <code>toJSON()</code> (Tao)</li>\n</ul>\n<h1>2.0.0</h1>\n<h2>Breaking changes</h2>\n<p>Breaking changes are in rarely used functionality, so we hope upgrade will be smooth for most users.</p>\n<ul>\n<li>Browser: The <code>.parse()</code> method has been renamed to <code>.serialize()</code> for consistency with NodeJS version.</li>\n<li>Browser: Query string keys without a value used to be parsed as <code>\'undefined\'</code>, now their value is <code>\'\'</code> (empty string) (shura, Kornel Lesiński).</li>\n<li>NodeJS: The <code>redirect</code> event is called after new query string and headers have been set and is allowed to override the request URL (Kornel Lesiński)</li>\n<li><code>.then()</code> returns a real <code>Promise</code>. Note that use of superagent with promises now requires a global <code>Promise</code> object.\nIf you target Internet Explorer or Node 0.10, you\'ll need <code>require(\'es6-promise\').polyfill()</code> or similar.</li>\n<li>Upgraded all dependencies (Peter Lyons)</li>\n<li>Renamed properties documented as <code>@api private</code> to have <code>_prefixed</code> names (Kornel Lesiński)</li>\n</ul>\n<h2>Probably not breaking changes:</h2>\n<ul>\n<li>Extracted common functions to request-base (Peter Lyons)</li>\n<li>Fixed race condition in pipe tests (Peter Lyons)</li>\n<li>Handle <code>FormData</code> error events (scriptype)</li>\n<li>Fixed wrong jsdoc of Request#attach (George Chung)</li>\n<li>Updated and improved tests (Peter Lyons)</li>\n<li><code>request.head()</code> supports <code>.redirects(5)</code> call (Kornel Lesiński)</li>\n<li><code>response</code> event is also emitted when using <code>.pipe()</code></li>\n</ul>\n<h1>1.8.2 (2016-03-20)</h1>\n<ul>\n<li>Fixed handling of HTTP status 204 with content-encoding: gzip (Andrew Shelton)</li>\n<li>Handling of FormData error events (scriptype)</li>\n<li>Fixed parsing of <code>vnd+json</code> MIME types (Kornel Lesiński)</li>\n<li>Aliased browser implementation of <code>.parse()</code> as <code>.serialize()</code> for forward compatibility</li>\n</ul>\n<h1>1.8.1 (2016-03-14)</h1>\n<ul>\n<li>Fixed form-data incompatibility with IE9</li>\n</ul>\n<h1>1.8.0 (2016-03-09)</h1>\n<ul>\n<li>\n<p>Extracted common code into request-base class (Peter Lyons)</p>\n<ul>\n<li>It does not affect the public API, but please let us know if you notice any plugins/subclasses breaking!</li>\n</ul>\n</li>\n<li>Added option <code>{type:\'auto\'}</code> to <code>auth</code> method, which enables browser-native auth types (Jungle, Askar Yusupov)</li>\n<li>Added <code>responseType()</code> to set XHR <code>responseType</code> (chris)</li>\n<li>Switched to form-data for browserify-compatible <code>FormData</code> (Peter Lyons)</li>\n<li>Added <code>statusCode</code> to error response when JSON response is malformed (mattdell)</li>\n<li>Prevented TCP port conflicts in all tests (Peter Lyons)</li>\n<li>Updated form-data dependency</li>\n</ul>\n<h1>1.7.2 (2016-01-26)</h1>\n<ul>\n<li>Fix case-sensitivity of header fields introduced by a4ddd6a. (Edward J. Jinotti)</li>\n<li>bump extend dependency, as former version did not contain any license information (Lukas Eipert)</li>\n</ul>\n<h1>1.7.1 (2016-01-21)</h1>\n<ul>\n<li>Fixed a conflict with express when using npm 3.x (Glenn)</li>\n<li>Fixed redirects after a multipart/form-data POST request (cyclist2)</li>\n</ul>\n<h1>1.7.0 (2016-01-18)</h1>\n<ul>\n<li>When attaching files, read default filename from the <code>File</code> object (JD Isaacks)</li>\n<li>Add <code>direction</code> property to <code>progress</code> events (Joseph Dykstra)</li>\n<li>Update component-emitter &#x26; formidable (Kornel Lesiński)</li>\n<li>Don\'t re-encode query string needlessly (Ruben Verborgh)</li>\n<li>ensure querystring is appended when doing <code>stream.pipe(request)</code> (Keith Grennan)</li>\n<li>change set header function, not call <code>this.request()</code> until call <code>this.end()</code> (vicanso)</li>\n<li>Add no-op <code>withCredentials</code> to Node API (markdalgleish)</li>\n<li>fix <code>delete</code> breaking on ie8 (kenjiokabe)</li>\n<li>Don\'t let request error override responses (Clay Reimann)</li>\n<li>Increased number of tests shared between node and client (Kornel Lesiński)</li>\n</ul>\n<h1>1.6.0/1.6.1 (2015-12-09)</h1>\n<ul>\n<li>avoid misleading CORS error message</li>\n<li>added \'progress\' event on file/form upload in Node (Olivier Lalonde)</li>\n<li>return raw response if the response parsing fails (Rei Colina)</li>\n<li>parse content-types ending with <code>+json</code> as JSON (Eiryyy)</li>\n<li>fix to avoid throwing errors on aborted requests (gjurgens)</li>\n<li>retain cookies on redirect when hosts match (Tom Conroy)</li>\n<li>added Bower manifest (Johnny Freeman)</li>\n<li>upgrade to latest cookiejar (Andy Burke)</li>\n</ul>\n<h1>1.5.0 (2015-11-30)</h1>\n<ul>\n<li>encode array values as <code>key=1&#x26;key=2&#x26;key=3</code> etc... (aalpern, Davis Kim)</li>\n<li>avoid the error which is omitted from \'socket hang up\'</li>\n<li>faster JSON parsing, handling of zlib errors (jbellenger)</li>\n<li>fix IE11 sends \'undefined\' string if data was undefined (Vadim Goncharov)</li>\n<li>alias <code>del()</code> method as <code>delete()</code> (Aaron Krause)</li>\n<li>revert Request#parse since it was actually Response#parse</li>\n</ul>\n<h1>1.4.0 (2015-09-14)</h1>\n<ul>\n<li>add Request#parse method to client library</li>\n<li>add missing statusCode in client response</li>\n<li>don\'t apply JSON heuristics if a valid parser is found</li>\n<li>fix detection of root object for webworkers</li>\n</ul>\n<h1>1.3.0 (2015-08-05)</h1>\n<ul>\n<li>fix incorrect content-length of data set to buffer</li>\n<li>serialize request data takes into account charsets</li>\n<li>add basic promise support via a <code>then</code> function</li>\n</ul>\n<h1>1.2.0 (2015-04-13)</h1>\n<ul>\n<li>add progress events to downlodas</li>\n<li>make usable in webworkers</li>\n<li>add support for 308 redirects</li>\n<li>update node-form-data dependency</li>\n<li>update to work in react native</li>\n<li>update node-mime dependency</li>\n</ul>\n<h1>1.1.0 (2015-03-13)</h1>\n<ul>\n<li>Fix responseType checks without xhr2 and ie9 tests (rase-)</li>\n<li>errors have .status and .response fields if applicable (defunctzombie)</li>\n<li>fix end callback called before saving cookies (rase-)</li>\n</ul>\n<h1>1.0.0 / 2015-03-08</h1>\n<ul>\n<li>All non-200 responses are treated as errors now. (The callback is called with an error when the response has a status &#x3C; 200 or >= 300 now. In previous versions this would not have raised an error and the client would have to check the <code>res</code> object. See <a href="https://github.com/visionmedia/superagent/issues/283">#283</a>.</li>\n<li>keep timeouts intact across redirects (hopkinsth)</li>\n<li>handle falsy json values (themaarten)</li>\n<li>fire response events in browser version (Schoonology)</li>\n<li>getXHR exported in client version (KidsKilla)</li>\n<li>remove arity check on <code>.end()</code> callbacks (defunctzombie)</li>\n<li>avoid setting content-type for host objects (rexxars)</li>\n<li>don\'t index array strings in querystring (travisjeffery)</li>\n<li>fix pipe() with redirects (cyrilis)</li>\n<li>add xhr2 file download (vstirbu)</li>\n<li>set default response type to text/plain if not specified (warrenseine)</li>\n</ul>\n<h1>0.21.0 / 2014-11-11</h1>\n<ul>\n<li>Trim text before parsing json (gjohnson)</li>\n<li>Update tests to express 4 (gaastonsr)</li>\n<li>Prevent double callback when error is thrown (pgn-vole)</li>\n<li>Fix missing clearTimeout (nickdima)</li>\n<li>Update debug (TooTallNate)</li>\n</ul>\n<h1>0.20.0 / 2014-10-02</h1>\n<ul>\n<li>Add toJSON() to request and response instances. (yields)</li>\n<li>Prevent HEAD requests from getting parsed. (gjohnson)</li>\n<li>Update debug. (TooTallNate)</li>\n</ul>\n<h1>0.19.1 / 2014-09-24</h1>\n<ul>\n<li>Fix basic auth issue when password is falsey value. (gjohnson)</li>\n</ul>\n<h1>0.19.0 / 2014-09-24</h1>\n<ul>\n<li>Add unset() to browser. (shesek)</li>\n<li>Prefer XHR over ActiveX. (omeid)</li>\n<li>Catch parse errors. (jacwright)</li>\n<li>Update qs dependency. (wercker)</li>\n<li>Add use() to node. (Financial-Times)</li>\n<li>Add response text to errors. (yields)</li>\n<li>Don\'t send empty cookie headers. (undoZen)</li>\n<li>Don\'t parse empty response bodies. (DveMac)</li>\n<li>Use hostname when setting cookie host. (prasunsultania)</li>\n</ul>\n<h1>0.18.2 / 2014-07-12</h1>\n<ul>\n<li>Handle parser errors. (kof)</li>\n<li>Ensure not to use default parsers when there is a user defined one. (kof)</li>\n</ul>\n<h1>0.18.1 / 2014-07-05</h1>\n<ul>\n<li>Upgrade cookiejar dependency (juanpin)</li>\n<li>Support image mime types (nebulade)</li>\n<li>Make .agent chainable (kof)</li>\n<li>Upgrade debug (TooTallNate)</li>\n<li>Fix docs (aheckmann)</li>\n</ul>\n<h1>0.18.0 / 2014-04-29</h1>\n<ul>\n<li>\n<p>Use "form-data" module for the multipart/form-data implementation. (TooTallNate)</p>\n</li>\n<li>\n<p>Add basic <code>field()</code> and <code>attach()</code> functions for HTML5 FormData. (TooTallNate)</p>\n</li>\n<li>\n<p>Deprecate <code>part()</code>. (TooTallNate)</p>\n</li>\n<li>\n<p>Set default user-agent header. (bevacqua)</p>\n</li>\n<li>\n<p>Add <code>unset()</code> method for removing headers. (bevacqua)</p>\n</li>\n<li>\n<p>Update cookiejar. (missinglink)</p>\n</li>\n<li>\n<p>Fix response error formatting. (shesek)</p>\n<h1>0.17.0 / 2014-03-06</h1>\n</li>\n<li>\n<p>supply uri malformed error to the callback (yields)</p>\n</li>\n<li>\n<p>add request event (yields)</p>\n</li>\n<li>\n<p>allow simple auth (yields)</p>\n</li>\n<li>\n<p>add request event (yields)</p>\n</li>\n<li>\n<p>switch to component/reduce (visionmedia)</p>\n</li>\n<li>\n<p>fix part content-disposition (mscdex)</p>\n</li>\n<li>\n<p>add browser testing via zuul (defunctzombie)</p>\n</li>\n<li>\n<p>adds request.use() (johntron)</p>\n</li>\n</ul>\n<h1>0.16.0 / 2014-01-07</h1>\n<ul>\n<li>remove support for 0.6 (superjoe30)</li>\n<li>fix CORS withCredentials (wejendorp)</li>\n<li>add "test" script (superjoe30)</li>\n<li>add request .accept() method (nickl-)</li>\n<li>add xml to mime types mappings (nickl-)</li>\n<li>fix parse body error on HEAD requests (gjohnson)</li>\n<li>fix documentation typos (matteofigus)</li>\n<li>fix content-type + charset (bengourley)</li>\n<li>fix null values on query parameters (cristiandouce)</li>\n</ul>\n<h1>0.15.7 / 2013-10-19</h1>\n<ul>\n<li>pin should.js to 1.3.0 due to breaking change in 2.0.x</li>\n<li>fix browserify regression</li>\n</ul>\n<h1>0.15.5 / 2013-10-09</h1>\n<ul>\n<li>add browser field to support browserify</li>\n<li>fix .field() value number support</li>\n</ul>\n<h1>0.15.4 / 2013-07-09</h1>\n<ul>\n<li>node: add a Request#agent() function to set the http Agent to use</li>\n</ul>\n<h1>0.15.3 / 2013-07-05</h1>\n<ul>\n<li>fix .pipe() unzipping on more recent nodes. Closes #240</li>\n<li>fix passing an empty object to .query() no longer appends "?"</li>\n<li>fix formidable error handling</li>\n<li>update formidable</li>\n</ul>\n<h1>0.15.2 / 2013-07-02</h1>\n<ul>\n<li>fix: emit \'end\' when piping.</li>\n</ul>\n<h1>0.15.1 / 2013-06-26</h1>\n<ul>\n<li>add try/catch around parseLinks</li>\n</ul>\n<h1>0.15.0 / 2013-06-25</h1>\n<ul>\n<li>make <code>Response#toError()</code> have a more meaningful <code>message</code></li>\n</ul>\n<h1>0.14.9 / 2013-06-15</h1>\n<ul>\n<li>add debug()s to the node client</li>\n<li>add .abort() method to node client</li>\n</ul>\n<h1>0.14.8 / 2013-06-13</h1>\n<ul>\n<li>set .agent = false always</li>\n<li>remove X-Requested-With. Closes #189</li>\n</ul>\n<h1>0.14.7 / 2013-06-06</h1>\n<ul>\n<li>fix unzip error handling</li>\n</ul>\n<h1>0.14.6 / 2013-05-23</h1>\n<ul>\n<li>fix HEAD unzip bug</li>\n</ul>\n<h1>0.14.5 / 2013-05-23</h1>\n<ul>\n<li>add flag to ensure the callback is <strong>never</strong> invoked twice</li>\n</ul>\n<h1>0.14.4 / 2013-05-22</h1>\n<ul>\n<li>add superagent.js build output</li>\n<li>update qs</li>\n<li>update emitter-component</li>\n<li>revert "add browser field to support browserify" see GH-221</li>\n</ul>\n<h1>0.14.3 / 2013-05-18</h1>\n<ul>\n<li>add browser field to support browserify</li>\n</ul>\n<h1>0.14.2/ 2013-05-07</h1>\n<ul>\n<li>add host object check to fix serialization of File/Blobs etc as json</li>\n</ul>\n<h1>0.14.1 / 2013-04-09</h1>\n<ul>\n<li>update qs</li>\n</ul>\n<h1>0.14.0 / 2013-04-02</h1>\n<ul>\n<li>add client-side basic auth</li>\n<li>fix retaining of .set() header field case</li>\n</ul>\n<h1>0.13.0 / 2013-03-13</h1>\n<ul>\n<li>add progress events to client</li>\n<li>add simple example</li>\n<li>add res.headers as alias of res.header for browser client</li>\n<li>add res.get(field) to node/client</li>\n</ul>\n<h1>0.12.4 / 2013-02-11</h1>\n<ul>\n<li>fix get content-type even if can\'t get other headers in firefox. fixes #181</li>\n</ul>\n<h1>0.12.3 / 2013-02-11</h1>\n<ul>\n<li>add quick "progress" event support</li>\n</ul>\n<h1>0.12.2 / 2013-02-04</h1>\n<ul>\n<li>add test to check if response acts as a readable stream</li>\n<li>add ReadableStream in the Response prototype.</li>\n<li>add test to assert correct redirection when the host changes in the location header.</li>\n<li>add default Accept-Encoding. Closes #155</li>\n<li>fix req.pipe() return value of original stream for node parity. Closes #171</li>\n<li>remove the host header when cleaning headers to properly follow the redirection.</li>\n</ul>\n<h1>0.12.1 / 2013-01-10</h1>\n<ul>\n<li>add x-domain error handling</li>\n</ul>\n<h1>0.12.0 / 2013-01-04</h1>\n<ul>\n<li>add header persistence on redirects</li>\n</ul>\n<h1>0.11.0 / 2013-01-02</h1>\n<ul>\n<li>add .error Error object. Closes #156</li>\n<li>add forcing of res.text removal for FF HEAD responses. Closes #162</li>\n<li>add reduce component usage. Closes #90</li>\n<li>move better-assert dep to development deps</li>\n</ul>\n<h1>0.10.0 / 2012-11-14</h1>\n<ul>\n<li>add req.timeout(ms) support for the client</li>\n</ul>\n<h1>0.9.10 / 2012-11-14</h1>\n<ul>\n<li>fix client-side .query(str) support</li>\n</ul>\n<h1>0.9.9 / 2012-11-14</h1>\n<ul>\n<li>add .parse(fn) support</li>\n<li>fix socket hangup with dates in querystring. Closes #146</li>\n<li>fix socket hangup "error" event when a callback of arity 2 is provided</li>\n</ul>\n<h1>0.9.8 / 2012-11-03</h1>\n<ul>\n<li>add emission of error from <code>Request#callback()</code></li>\n<li>add a better fix for nodes weird socket hang up error</li>\n<li>add PUT/POST/PATCH data support to client short-hand functions</li>\n<li>add .license property to component.json</li>\n<li>change client portion to build using component(1)</li>\n<li>fix GET body support [guille]</li>\n</ul>\n<h1>0.9.7 / 2012-10-19</h1>\n<ul>\n<li>fix <code>.buffer()</code> <code>res.text</code> when no parser matches</li>\n</ul>\n<h1>0.9.6 / 2012-10-17</h1>\n<ul>\n<li>change: use <code>this</code> when <code>window</code> is undefined</li>\n<li>update to new component spec [juliangruber]</li>\n<li>fix emission of "data" events for compressed responses without encoding. Closes #125</li>\n</ul>\n<h1>0.9.5 / 2012-10-01</h1>\n<ul>\n<li>add field name to .attach()</li>\n<li>add text "parser"</li>\n<li>refactor isObject()</li>\n<li>remove wtf isFunction() helper</li>\n</ul>\n<h1>0.9.4 / 2012-09-20</h1>\n<ul>\n<li>fix <code>Buffer</code> responses [TooTallNate]</li>\n<li>fix <code>res.type</code> when a "type" param is present [TooTallNate]</li>\n</ul>\n<h1>0.9.3 / 2012-09-18</h1>\n<ul>\n<li>remove <strong>GET</strong> <code>.send()</code> == <code>.query()</code> special-case (<strong>API</strong> change !!!)</li>\n</ul>\n<h1>0.9.2 / 2012-09-17</h1>\n<ul>\n<li>add <code>.aborted</code> prop</li>\n<li>add <code>.abort()</code>. Closes #115</li>\n</ul>\n<h1>0.9.1 / 2012-09-07</h1>\n<ul>\n<li>add <code>.forbidden</code> response property</li>\n<li>add component.json</li>\n<li>change emitter-component to 0.0.5</li>\n<li>fix client-side tests</li>\n</ul>\n<h1>0.9.0 / 2012-08-28</h1>\n<ul>\n<li>add <code>.timeout(ms)</code>. Closes #17</li>\n</ul>\n<h1>0.8.2 / 2012-08-28</h1>\n<ul>\n<li>fix pathname relative redirects. Closes #112</li>\n</ul>\n<h1>0.8.1 / 2012-08-21</h1>\n<ul>\n<li>fix redirects when schema is specified</li>\n</ul>\n<h1>0.8.0 / 2012-08-19</h1>\n<ul>\n<li>add <code>res.buffered</code> flag</li>\n<li>add buffering of text/*, json and forms only by default. Closes #61</li>\n<li>add <code>.buffer(false)</code> cancellation</li>\n<li>add cookie jar support [hunterloftis]</li>\n<li>add agent functionality [hunterloftis]</li>\n</ul>\n<h1>0.7.0 / 2012-08-03</h1>\n<ul>\n<li>allow <code>query()</code> to be called after the internal <code>req</code> has been created [tootallnate]</li>\n</ul>\n<h1>0.6.0 / 2012-07-17</h1>\n<ul>\n<li>add <code>res.send(\'foo=bar\')</code> default of "application/x-www-form-urlencoded"</li>\n</ul>\n<h1>0.5.1 / 2012-07-16</h1>\n<ul>\n<li>add "methods" dep</li>\n<li>add <code>.end()</code> arity check to node callbacks</li>\n<li>fix unzip support due to weird node internals</li>\n</ul>\n<h1>0.5.0 / 2012-06-16</h1>\n<ul>\n<li>Added "Link" response header field parsing, exposing <code>res.links</code></li>\n</ul>\n<h1>0.4.3 / 2012-06-15</h1>\n<ul>\n<li>Added 303, 305 and 307 as redirect status codes [slaskis]</li>\n<li>Fixed passing an object as the url</li>\n</ul>\n<h1>0.4.2 / 2012-06-02</h1>\n<ul>\n<li>Added component support</li>\n<li>Fixed redirect data</li>\n</ul>\n<h1>0.4.1 / 2012-04-13</h1>\n<ul>\n<li>Added HTTP PATCH support</li>\n<li>Fixed: GET / HEAD when following redirects. Closes #86</li>\n<li>Fixed Content-Length detection for multibyte chars</li>\n</ul>\n<h1>0.4.0 / 2012-03-04</h1>\n<ul>\n<li>Added <code>.head()</code> method [browser]. Closes #78</li>\n<li>Added <code>make test-cov</code> support</li>\n<li>Added multipart request support. Closes #11</li>\n<li>Added all methods that node supports. Closes #71</li>\n<li>Added "response" event providing a Response object. Closes #28</li>\n<li>Added <code>.query(obj)</code>. Closes #59</li>\n<li>Added <code>res.type</code> (browser). Closes #54</li>\n<li>Changed: default <code>res.body</code> and <code>res.files</code> to {}</li>\n<li>Fixed: port existing query-string fix (browser). Closes #57</li>\n</ul>\n<h1>0.3.0 / 2012-01-24</h1>\n<ul>\n<li>Added deflate/gzip support [guillermo]</li>\n<li>Added <code>res.type</code> (Content-Type void of params)</li>\n<li>Added <code>res.statusCode</code> to mirror node</li>\n<li>Added <code>res.headers</code> to mirror node</li>\n<li>Changed: parsers take callbacks</li>\n<li>Fixed optional schema support. Closes #49</li>\n</ul>\n<h1>0.2.0 / 2012-01-05</h1>\n<ul>\n<li>Added url auth support</li>\n<li>Added <code>.auth(username, password)</code></li>\n<li>Added basic auth support [node]. Closes #41</li>\n<li>Added <code>make test-docs</code></li>\n<li>Added guillermo\'s EventEmitter. Closes #16</li>\n<li>Removed <code>Request#data()</code> for SS, renamed to <code>send()</code></li>\n<li>Removed <code>Request#data()</code> from client, renamed to <code>send()</code></li>\n<li>Fixed array support. [browser]</li>\n<li>Fixed array support. Closes #35 [node]</li>\n<li>Fixed <code>EventEmitter#emit()</code></li>\n</ul>\n<h1>0.1.3 / 2011-10-25</h1>\n<ul>\n<li>Added error to callback</li>\n<li>Bumped node dep for 0.5.x</li>\n</ul>\n<h1>0.1.2 / 2011-09-24</h1>\n<ul>\n<li>Added markdown documentation</li>\n<li>Added <code>request(url[, fn])</code> support to the client</li>\n<li>Added <code>qs</code> dependency to package.json</li>\n<li>Added options for <code>Request#pipe()</code></li>\n<li>Added support for <code>request(url, callback)</code></li>\n<li>Added <code>request(url)</code> as shortcut for <code>request.get(url)</code></li>\n<li>Added <code>Request#pipe(stream)</code></li>\n<li>Added inherit from <code>Stream</code></li>\n<li>Added multipart support</li>\n<li>Added ssl support (node)</li>\n<li>Removed Content-Length field from client</li>\n<li>Fixed buffering, <code>setEncoding()</code> to utf8 [reported by stagas]</li>\n<li>Fixed "end" event when piping</li>\n</ul>\n<h1>0.1.1 / 2011-08-20</h1>\n<ul>\n<li>Added <code>res.redirect</code> flag (node)</li>\n<li>Added redirect support (node)</li>\n<li>Added <code>Request#redirects(n)</code> (node)</li>\n<li>Added <code>.set(object)</code> header field support</li>\n<li>Fixed <code>Content-Length</code> support</li>\n</ul>\n<h1>0.1.0 / 2011-08-09</h1>\n<ul>\n<li>Added support for multiple calls to <code>.data()</code></li>\n<li>Added support for <code>.get(uri, obj)</code></li>\n<li>Added GET <code>.data()</code> querystring support</li>\n<li>Added IE{6,7,8} support [alexyoung]</li>\n</ul>\n<h1>0.0.1 / 2011-08-05</h1>\n<ul>\n<li>Initial commit</li>\n</ul>',docPath:"argo-ci/node_modules/superagent/history",proj:"argo-ci"}}}});
